var create = require('./create');

function Hashmap(id) {
    return create('hashmap');
}

function List(id) {
    return create('list');
}

function Set(id) {
    return create('set');
}

function Promise(id) {
    return create('promise');
}

module.exports.Hashmap = Hashmap;
module.exports.List = List;
module.exports.Promise = Promise;
